import { useEffect, useState } from "react";
import Axios from "axios";
import Table from "./trac_table";

function GetTable(props) {
  const [data, setData] = useState([]);


  useEffect(() => {
    getUsers();
  }, []);

  const column = [
    { heading: "ID", value: "id" },
    { heading: "Matricule", value: "Matricule" },
    { heading: "User", value: "User" },
    { heading: "Lot", value: "Lot" },
    { heading: "Of", value: "Of" },
    { heading: "Reference", value: "Table" },
    { heading: "Type", value: "Commentaire" },
    { heading: "Qte_Saisi", value: "Qte_Saisi" },
    { heading: "Date d'opération", value: "Date_doperation" },
  ];
  return <Table data={data} column={column} />;
}

export default GetTable;
